import React from 'react';
import Grid from "../UI/Grid/Grid";
import Card from "./Card/Card";

type Word = {
  text: string;
  tran: string;
  lang: number;
  pos: string;
}

type MyProps = {
  words: Word[];
}

function Cards(props: MyProps) {
  return (
    <Grid>
      {props.words.map((word: Word, index: number) =>
        <Card
          key={index}
          text={word.text}
          tran={word.tran}
          lang={word.lang}
          pos={word.pos}
        />
      )}
    </Grid>
  );
}

export default Cards;
